var img="data:image/png;base64,"

var doc = new jsPDF();

doc.setFontSize(50);

//(x, y, texto)
doc.text(35, 25, 'Example');

//(Distancia que alberga tu imagen, formato, x, y, ancho, largo)
doc.addImage(img, 'JPEG', 15, 40, 180, 160);

//Agrega un triángulo al documento, las variables se organizan en: 
doc.triangle(100, 80, 400, 300, 9, 57);

var nombre=getElementById("texto");
doc.text(60, 60, nombre);

//Guardar pdf 

doc.save('Example.pdf');